(3, 43, NULL, 'Schroff Memorial National Award 2018 ', '<p><img src=\"https://www.gniindia.org/images/suresh-award.jpg\" width=\"100%\">                                                                                        </p><p><span style=\"color: rgb(51, 51, 51); font-family: WorkSans-Regular;\">Guru Nanak Institutions congratulates Dr. P. Suresh, Principal  School of Pharmacy, for the Schroff Memorial National Award 2018 in recognition to Hospital Pharmacy Services, During 70th Indian Pharmaceutical Congress held at Amity University, Noida on 21/12/2018. We wish him all the best for all his future endeavors.</span><br></p>', '2020-08-14 08:47:30', '0000-00-00 00:00:00', 'Active', 1),
(4, 43, NULL, 'SCHROFF MEMORIAL NATIONAL AWARD', '                                                                                                                                    <p><img src=\"https://www.gniindia.org/images/suresh-award.jpg\" width=\"100%\">                                                                                        </p><p><span style=\"color: rgb(51, 51, 51); font-family: WorkSans-Regular;\">Guru Nanak Institutions congratulates Dr. P. Suresh, Principal  School of Pharmacy, for the Schroff Memorial National Award 2018 in recognition to Hospital Pharmacy Services, During 70th Indian Pharmaceutical Congress held at Amity University, Noida on 21/12/2018. We wish him all the best for all his future endeavors.</span><br></p>                                                                                                                                    ', '2020-08-14 08:47:39', '0000-00-00 00:00:00', 'Active', 0),
(5, 43, NULL, 'QUALITY PROFESSIONAL INSTITUTION OF THE YEAR ', '                                                                                        <p><img src=\"https://www.gniindia.org/gnitc/images/ha1.jpg\" width=\"100%\"></p><p><span style=\"color: rgb(51, 51, 51); font-family: WorkSans-Regular;\">Guru Nanak Institution has been recognized as </span><em style=\"color: rgb(51, 51, 51); font-family: WorkSans-Regular;\">Quality Professional Institution of the Year, Telangana</em><span style=\"color: rgb(51, 51, 51); font-family: WorkSans-Regular;\"> and was conferred with </span><em style=\"color: rgb(51, 51, 51); font-family: WorkSans-Regular;\">Certificate of Excellence Award</em><span style=\"color: rgb(51, 51, 51); font-family: WorkSans-Regular;\"> by Brands Academy during the occasion of Global Quality Awards 2016 on February 06, 2016</span><br></p><p>                                                                                        </p>                                                                                        ', '2020-08-14 08:50:59', '0000-00-00 00:00:00', 'Active', 0),
(6, 43, NULL, 'Award for Educational Excellence, presentedin Indo-Global Education Summit', '<p><img src=\"https://www.gniindia.org/gnitc/images/ha2.jpg\" width=\"100%\">                                                                                        </p>', '2020-08-14 08:59:59', '0000-00-00 00:00:00', 'Active', 0),
(7, 43, NULL, 'PHARMACY STUDENTS ACHIVEMENTS', '                                                                                                                                    <p style=\"margin: 1em 0px 0px; font-size: 15px; color: rgb(49, 49, 49); line-height: 1.8em; text-align: justify; font-family: WorkSans-Regular;\">GNI congratulate M. SAI VEERA MANIKANTA (II-B.PHARM I-SEM,SEC-B 13WJ1R0054) for securing the First Place in 400 M & Third Place in 100 M in 1st TELENGANA STATE INTER DISTRICT JUNIOR ATHLETICS CHAMPIONSHIP Organised By HYDERABAD DISTRICT ATHLETICS ASSOCIATION Under The Aegis of TELANGANA ATHLETICS ASSOCIATION at GMC Balayogi Athletics Stadium, Gachi Bowli On 13th & 14th September 2014.<br><img src=\"https://www.gniindia.org/gnitc/sp/images/sai-sport.jpg\" style=\"border: 0px;\"><br></p><br style=\"color: rgb(51, 51, 51); font-family: WorkSans-Regular;\"><p style=\"margin: 1em 0px 0px; font-size: 15px; color: rgb(49, 49, 49); line-height: 1.8em; text-align: justify; font-family: WorkSans-Regular;\"><strong style=\"font-weight: bold;\">Mr. P. V. Lalith</strong>and<strong style=\"font-weight: bold;\">Mr. CH. Srinivas</strong>has won first prize for oral presentation in Tech Samprathi 2K13 organized by Nalla Narsimha Reddy - School Of Pharmacy, Ghatkesar, Hyderabad.</p><br style=\"color: rgb(51, 51, 51); font-family: WorkSans-Regular;\"><p style=\"margin: 1em 0px 0px; font-size: 15px; color: rgb(49, 49, 49); line-height: 1.8em; text-align: justify; font-family: WorkSans-Regular;\"><strong style=\"font-weight: bold;\">Mr. Farooq Ali Khan</strong>has won first prize in Compound Preparation organized by Anurag Group of Institutions, Hyderabad.<br></p><br style=\"color: rgb(51, 51, 51); font-family: WorkSans-Regular;\"><p style=\"margin: 1em 0px 0px; font-size: 15px; color: rgb(49, 49, 49); line-height: 1.8em; text-align: justify; font-family: WorkSans-Regular;\"><strong style=\"font-weight: bold;\">Mr. Amit Phogat</strong>and<strong style=\"font-weight: bold;\">Mr. Farooq Ali Khan</strong>won second prize in Technical Quiz organized by Anurag Group of Institutions, Hyderabad.<br></p><br style=\"color: rgb(51, 51, 51); font-family: WorkSans-Regular;\"><p style=\"margin: 1em 0px 0px; font-size: 15px; color: rgb(49, 49, 49); line-height: 1.8em; text-align: justify; font-family: WorkSans-Regular;\"><strong style=\"font-weight: bold;\">Mr. Amit Phoga</strong>t and<strong style=\"font-weight: bold;\">Mr. A. Praveen Reddy</strong>has won first prize in poster presentation entitled Pharmacosomes - An Overview organized by Anurag Group of Institutions, Hyderabad.<br></p><br style=\"color: rgb(51, 51, 51); font-family: WorkSans-Regular;\"><p style=\"margin: 1em 0px 0px; font-size: 15px; color: rgb(49, 49, 49); line-height: 1.8em; text-align: justify; font-family: WorkSans-Regular;\"><strong style=\"font-weight: bold;\">Mr. P. V. Lalith</strong>has won first prize in Goko Quiz organized by Anurag Group of Institutions, Hyderabad.<br></p><br style=\"color: rgb(51, 51, 51); font-family: WorkSans-Regular;\"><p style=\"margin: 1em 0px 0px; font-size: 15px; color: rgb(49, 49, 49); line-height: 1.8em; text-align: justify; font-family: WorkSans-Regular;\"><strong style=\"font-weight: bold;\">Ms. Syeda Sammera, Ms. Fariya sultana, Ms. A. Supritha</strong>and<strong style=\"font-weight: bold;\">Ms. Shaista Fathima</strong>has won First Runner up in Pharma Quiz at National level seminar on Drug discovery development and clinical trials organized by Sri Indu Institute of Pharmacy, Hyderabad.<br></p><br style=\"color: rgb(51, 51, 51); font-family: WorkSans-Regular;\"><p style=\"margin: 1em 0px 0px; font-size: 15px; color: rgb(49, 49, 49); line-height: 1.8em; text-align: justify; font-family: WorkSans-Regular;\"><strong style=\"font-weight: bold;\">Mr. Mafaheem Shabaz</strong>has won first prize in Chess organized by Bharat Institute of Technology, Mangalpally, Hyderabad.<br></p><br style=\"color: rgb(51, 51, 51); font-family: WorkSans-Regular;\"><p style=\"margin: 1em 0px 0px; font-size: 15px; color: rgb(49, 49, 49); line-height: 1.8em; text-align: justify; font-family: WorkSans-Regular;\"><strong style=\"font-weight: bold;\">Ms. E. Sravanthi Reddy</strong>has won first prize for oral presentation titled Mucoadhesive dosage forms  an overview organized by T.K.R. College of Pharmacy, Meerpet, Hyderabad.<br></p><br style=\"color: rgb(51, 51, 51); font-family: WorkSans-Regular;\"><p style=\"margin: 1em 0px 0px; font-size: 15px; color: rgb(49, 49, 49); line-height: 1.8em; text-align: justify; font-family: WorkSans-Regular;\"><strong style=\"font-weight: bold;\">Ms. Vydyam Datta Sankeertana</strong>has won first prize for oral presentation for the title Heparin Therapy organized by G. Pulla Reddy College of Pharmacy, Mehdipatnam, Hyderabad.<br></p><br style=\"color: rgb(51, 51, 51); font-family: WorkSans-Regular;\"><p style=\"margin: 1em 0px 0px; font-size: 15px; color: rgb(49, 49, 49); line-height: 1.8em; text-align: justify; font-family: WorkSans-Regular;\"><strong style=\"font-weight: bold;\">Mr. Koushik Chowdhary</strong>and<strong style=\"font-weight: bold;\">Ms. Ganga Bhavani</strong>has won first prize on Chemical Engineering, organized by University College of Technology (A) Osmania University.</p>                                                                                                                                                                                                                            ', '2020-08-14 09:31:29', '0000-00-00 00:00:00', 'Active', 0),
