ackground-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">5.</span><span style=\"font-size: 7pt; color: rgb(71, 71, 71); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"></span><span style=\"color: rgb(71, 71, 71); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">Refund/replacement shall\r\nbe conditional and shall be with recourse available to KAB Consultantsin\r\ncase of any misuse by Buyer.</span><span style=\"font-size:10.5pt;font-family:\r\n\" arial\",\"sans-serif\";color:#474747\"=\"\"><o:p></o:p></span></font></p><p style=\"margin-left: 0.75in; text-indent: -0.25in; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><font face=\"Times New Roman\"><span style=\"color: rgb(71, 71, 71); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">6.</span><span style=\"font-size: 7pt; color: rgb(71, 71, 71); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"></span><span style=\"color: rgb(71, 71, 71); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">Refund/replacement shall\r\nbe subject to Buyer complying with KAB Consultants Policies.</span><span style=\"font-size:10.5pt;font-family:\" arial\",\"sans-serif\";color:#474747\"=\"\"><o:p></o:p></span></font></p><p style=\"margin-left: 0.75in; text-indent: -0.25in; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><font face=\"Times New Roman\"><span style=\"color: rgb(71, 71, 71); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">7.</span><span style=\"font-size: 7pt; color: rgb(71, 71, 71); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"></span><span style=\"font-size: 10.5pt; color: rgb(71, 71, 71); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"></span><span style=\"color: rgb(71, 71, 71); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">Once\r\nBuyer has raised a return/replacement request, the following steps shall be\r\nfollowed:</span><span style=\"font-size:10.5pt;font-family:\" arial\",\"sans-serif\";=\"\" color:#474747\"=\"\"><o:p></o:p></span></font></p><p style=\"margin-left: 63.8pt; text-indent: -21.25pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><font face=\"Times New Roman\"><span style=\"color: rgb(71, 71, 71); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"></span><span style=\"font-size:10.5pt;font-family:\" arial\",\"sans-serif\";color:#474747\"=\"\"><o:p></o:p></span></font></p><p style=\"margin-left: 78.55pt; text-indent: -0.25in; line-height: 15pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><font face=\"Times New Roman\"><span style=\"color: rgb(71, 71, 71); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"></span><span style=\"font-size: 7pt; color: rgb(71, 71, 71); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"></span><span style=\"color: rgb(71, 71, 71); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">Buyer\r\nis asked for \"Reason for Return/Replacement\" - the Product is\r\nunopened and unused; the Product is defective/damaged; Product(s) was/were\r\nmissing; wrong Product was sent by the Seller.</span><span style=\"font-size:\r\n10.5pt;font-family:\" arial\",\"sans-serif\";color:#474747\"=\"\"><o:p></o:p></span></font></p><p style=\"margin-left: 78.55pt; text-indent: -0.25in; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><font face=\"Times New Roman\"><span style=\"color: rgb(71, 71, 71); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"></span><span style=\"font-size: 7pt; color: rgb(71, 71, 71); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"></span><span style=\"color: rgb(71, 71, 71); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">An\r\nintimationshall be provided to the Seller seeking either\r\n\"approval\" or \"rejection\" of the request.</span><span style=\"font-size:10.5pt;font-family:\" arial\",\"sans-serif\";color:#474747\"=\"\"><o:p></o:p></span></font></p><p style=\"margin-left: 78.55pt; text-indent: -0.25in; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><font face=\"Times New Roman\"><span style=\"color: rgb(71, 71, 71); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"></span><span style=\"font-size: 7pt; color: rgb(71, 71, 71); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"></span><span style=\"color: rgb(71, 71, 71); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">In case\r\nthe Seller accepts the return/replacement request, Buyer shall be required to\r\nreturn the product to the Seller and only after return of the Product in\r\nconformance with the conditions listedhereinbleow, Seller shall be\r\nobliged to issue a refund to the Buyer or send a replacement Product to the\r\nBuyer, as applicable.</span><span style=\"font-size:10.5pt;font-family:\" arial\",\"sans-serif\";=\"\" color:#474747\"=\"\"><o:p></o:p></span></font></p><p style=\"margin-left: 78.55pt; text-indent: -0.25in; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><font face=\"Times New Roman\"><span style=\"color: rgb(71, 71, 71); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"></span><span style=\"font-size: 7pt; color: rgb(71, 71, 71); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"></span><span style=\"color: rgb(71, 71, 71); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">IncaseSeller\r\nrejects the return/replacement request, Buyer can choose to raise a dispute by\r\nwriting to customer.support@KAB Consultants.com giving details of the order and\r\nthe return request.KAB Consultants shall endeavour to respond to such emails\r\nwithin 48 hours of receipt.</span><span style=\"font-size:10.5pt;font-family:\r\n\" arial\",\"sans-serif\";color:#474747\"=\"\"><o:p></o:p></span></font></p><p style=\"margin-left: 78.55pt; text-indent: -0.25in; background-image: ini