(1, 16, 'Content One Update', '                                            Content One Description                                            ', '2020-06-03 17:03:51', '0000-00-00 00:00:00', 'Active', 0),
(2, 43, 'Guru Nanak Institutions  19 Years of Excellence in Education', '<p class=\"m_1\" style=\"border: 0px; font-family: -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, &quot;Helvetica Neue&quot;, Arial, &quot;Noto Sans&quot;, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;, &quot;Segoe UI Symbol&quot;, &quot;Noto Color Emoji&quot;; font-size: 16px; margin-right: 0px; margin-left: 0px; outline: 0px; padding: 0px; vertical-align: baseline; color: rgb(33, 37, 41);\">Guru Nanak Institutions is one of the largest educational groups in India with 10,000+ Students currently enrolled in various programs of studies including Engineering and Technology, Pharmacy, Business Management and Dental Science.</p><p class=\"m_1 m_2\" style=\"border: 0px; font-family: -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, &quot;Helvetica Neue&quot;, Arial, &quot;Noto Sans&quot;, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;, &quot;Segoe UI Symbol&quot;, &quot;Noto Color Emoji&quot;; font-size: 16px; margin-right: 0px; margin-left: 0px; outline: 0px; padding: 0px; vertical-align: baseline; color: rgb(33, 37, 41);\"> Founded by visionary industrialist and well known philanthropist Sri Tavinder Singh Kohli, Founder and Chairman of GNI<br> The beginning happened with the foundation of Guru Nanak Educational Society in the year 1998<br> The dream of world class institutions was materialized with the establishment of Guru Nanak Institutions.<br><span style=\"font-weight: bolder;\">Guru Nanak Institutions currently has 11 education centers spread across Hyderabad, Nagpur and Roorkee.</span></p>                                                                                        ', '2020-08-12 11:04:45', '0000-00-00 00:00:00', 'Active', 1),
(3, 43, 'Guru Nanak Institutions  19 Years of Excellence in Education', '<p class=\"m_1\" style=\"border: 0px; font-family: -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, &quot;Helvetica Neue&quot;, Arial, &quot;Noto Sans&quot;, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;, &quot;Segoe UI Symbol&quot;, &quot;Noto Color Emoji&quot;; font-size: 16px; margin-right: 0px; margin-left: 0px; outline: 0px; padding: 0px; vertical-align: baseline; color: rgb(33, 37, 41);\">Guru Nanak Institutions is one of the largest educational groups in India with 10,000+ Students currently enrolled in various programs of studies including Engineering and Technology, Pharmacy, Business Management and Dental Science.</p><p class=\"m_1 m_2\" style=\"border: 0px; font-family: -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, &quot;Helvetica Neue&quot;, Arial, &quot;Noto Sans&quot;, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;, &quot;Segoe UI Symbol&quot;, &quot;Noto Color Emoji&quot;; font-size: 16px; margin-right: 0px; margin-left: 0px; outline: 0px; padding: 0px; vertical-align: baseline; color: rgb(33, 37, 41);\"> Founded by visionary industrialist and well known philanthropist Sri Tavinder Singh Kohli, Founder and Chairman of GNI<br> The beginning happened with the foundation of Guru Nanak Educational Society in the year 1998<br> The dream of world class institutions was materialized with the establishment of Guru Nanak Institutions.<br><span style=\"font-weight: bolder;\">Guru Nanak Institutions currently has 11 education centers spread across Hyderabad, Nagpur and Roorkee.</span></p>                                                                                        ', '2020-08-12 11:05:27', '0000-00-00 00:00:00', 'Active', 0),
(4, 43, 'Guru Nanak Institutions  A World-Class Campus in Every Way!', '<p class=\"m_1\" style=\"border: 0px; font-family: -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, &quot;Helvetica Neue&quot;, Arial, &quot;Noto Sans&quot;, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;, &quot;Segoe UI Symbol&quot;, &quot;Noto Color Emoji&quot;; font-size: 16px; margin-right: 0px; margin-left: 0px; outline: 0px; padding: 0px; vertical-align: baseline; color: rgb(33, 37, 41);\">The GNI Campus is an extensive campus created to give life a new dimension in academics  it is spread across 100 acres and has 10,000+ students from across the globe study and research in the fields of Engineering, Technology, Business Management and Pharmacy.</p><p class=\"m_1 m_2\" style=\"border: 0px; font-family: -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, &quot;Helvetica Neue&quot;, Arial, &quot;Noto Sans&quot;, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;, &quot;Segoe UI Symbol&quot;, &quot;Noto Color Emoji&quot;; font-size: 16px; margin-right: 0px; margin-left: 0px; outline: 0px; padding: 0px; vertical-align: baseline; color: rgb(33, 37, 41);\">The temple of higher learning with mind and body enriching atmosphere can be seen at GNI. Apart from academic blocks and buildings there are plenty of open space, sports grounds, lawns and greens that help students to relax while they are taking time out from their busy schedules.</p><p style=\"border: 0px; font-family: -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, &quot;Helvetica Neue&quot;, Arial, &quot;Noto Sans&quot;, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;, &quot;Segoe UI Symbol&quot;, &quot;Noto Color Emoji&quot;; font-size: 16px; margin-right: 0px; margin-left: 0px; outline: 0px; padding: 0px; vertical-align: baseline; color: rgb(33, 37, 41);\">Every department is hosted in a separate block and the architecture and the amenities in each building is pro health and promote a sense of calm and making students feel at home. Well-vntileted, spacious and well-furnished classrooms are very inviting and plesant to walk into.The comfort level provided in the infrasrutural facilities helps the students to focus on their academic pursuits in an uninterupted manner.</p><p style=\"border: 0px; font-family: -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, &quot;Helvetica Neue&quot;, Arial, &quot;Noto Sans&quot;, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;, &quot;Segoe UI Symbol&quot;, &quot;Noto Color Emoji&quot;; font-size: 16px; margin-right: 0px; margin-left: 0px; outline: 0px; padding: 0px; vertical-align: baseline; color: rgb(33, 37, 41);\">Advanced labs, truy sohisticated computer centres, with the latest hardware and software provide students the opportunity to gain hands-on learning and practical experience.</p>                                                                                        ', '2020-08-12 11:08:43', '0000-00-00 00:00:00', 'Active', 0),
(5, 43, 'Guru Nanak Institutions Technical Campus ', '<span style=\"color: rgb(51, 51, 51); font-family: WorkSans-Regular;\">Guru Nanak Institutions Technical Campus (GNITC) is established in year 2001 by Guru Nanak Educational Society under the Chairmanship of Philanthropist Sardar Tavinder Singh Kohli. The campus is constructed on sprawling 31.46 Acres of land situated in Ibrahimpatnam, RR District, Telangana State. The campus is very close proximity to Hyderabad Outer Ring Road; GNI Campus can be easily reached through all-weather concrete roads from Hyderabad city which is just 28 kilometres away distance from Hyderabad city or 26 kms from Rajiv Gandhi International Airport.</span><br style=\"color: rgb(51, 51, 51); font-family: WorkSans-Regular;\"><br style=\"color: rgb(51, 51, 51); font-family: WorkSans-Regular;\"><span style=\"color: rgb(51, 51, 51); font-family: WorkSans-Regular;\">The college started with an intake of 240 students and four engineering branches (CSE, ECE, EEE and IT). The school of Engineering &amp; Technology is offering seven UG courses in Engineering (Aeronautical, Civil, Computer Science, ECE, EEE, Information Technology and Mechanical) with an intake of 1320. The School of Pharmacy is offering B.Pharm and Pharma.D courses with an intake of 100 and 30 respectively.</span><br style=\"color: rgb(51, 51, 51); font-family: WorkSans-Regular;\"><br style=\"color: rgb(51, 51, 51); font-family: WorkSans-Regular;\"><span style=\"color: rgb(51, 51, 51); font-family: WorkSans-Regular;\">Guru Nanak Institutions Technical Campus is conferred with Autonomous Status by University Grants Commission from the academic year 2016  17 onwards.</span><br style=\"color: rgb(51, 51, 51); font-family: WorkSans-Regular;\"><br style=\"color: rgb(51, 51, 51); font-family: WorkSans-Regular;\"><span style=\"color: rgb(51, 51, 51); font-family: WorkSans-Regular;\">Guru Nanak Institutions Technical Campus consists of four schools, School of Engineering and Technology, School of Pharmacy, School of Management and School of Computer Applications.</span>                                                                                        ', '2020-08-12 11:12:22', '0000-00-00 00:00:00', 'Active', 0);
