(23, 56, 'N. Rama Kumari', 'ramakabneelayavalasa@gmail.com', 'Professor', 'Ph. D', 'Institute for Academic Excellence', '15', '<p style=\"box-sizing: inherit; margin-right: 0px; margin-bottom: 0.7em; margin-left: 0px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; line-height: 1.5;\">Advanced Computer Algorithm<br>Parallel computing<br>Graphical and Visual computing</p>', 'English, Telugu and Hindi', 'The 2014 Leo Szilard Award, American Physical Society, USA\r\n2. Elected Co-chair of the International Panel on Fissile Materials (2008-2014)', 'Counsel', 'Dr. Jane Wright is a professor of Biology at the University of California, Los Angeles. She received her B.S from UCLA and her M.D. from Penn State University before eventually becoming supervising doctor at the Pennsylvania Hospital Emergency Center in 1997. After her fifteen-year career as a supervisor there, Dr. Wright returned to Los Angeles, where she accepted a tenure position at her alma mater UCLA. In addition to teaching, Dr. Wright is a regular contributor to National Science Quarterly and an enthusiastic Lakers fan. She recently collaborated on a manuscript with friend and colleague, Dr. Sam Smith, entitled Parkinsons and the Genetic Response to Eastern Medicine, in which she and Dr. Smith presented research compiled during three summers spent in India. She currently resides in Los Angeles with her husband Frank and their dog Lucy. She can be contacted at Jane (at) Janewright (dot) com.', 'Dr. N. Rama Kumari is a professor of Biology at the University of California, Los Angeles. She received her B.S from UCLA and her M.D. from Penn State University before eventually becoming supervising doctor at the Pennsylvania Hospital Emergency Center in 1997. After her fifteen-year career as a supervisor there, Dr. Wright returned to Los Angeles, where she accepted a tenure position at her alma mater UCLA. In addition to teaching, Dr. Wright is a regular contributor to National Science Quarterly and an enthusiastic Lakers fan. She recently collaborated on a manuscript with friend and colleague, Dr. Sam Smith, entitled Parkinsons and the Genetic Response to Eastern Medicine, in which she and Dr. Smith presented research compiled during three summers spent in India. She currently resides in Los Angeles with her husband Frank and their dog Lucy. She can be contacted at Jane (at) Janewright (dot) com.', 'Female', 'oto', '600', '1200', 'ramakabneelayavalasa@gmail.com', 'OVZuN1ZVcFRyaDZjTWxjNmNUdEY1UT09', '9618322400', '9618322400', 'Active', 'One to One interaction', 'www.linkedin.com/RamaKumari', 'www.youtube.com/kRamakumari', 'assets/experts/28049.jpg', 'IT', '2020-10-09 10:31:22', '0000-00-00 00:00:00', 0),
(24, 56, 'G Kranthi raj Goud ', '', 'Professor', 'Phd', 'St Josephs college', '10', '<p>Probability Theory and Applications</p><p> Aspects of Bioinformatics and Statistics</p>', 'Telugu, Hindi and English', '', '', '    Promote classroom discussion by suggesting topics, modeling best practices when analyzing literature and language, and interjecting when necessary.\r\n    Develop instructional content focusing on specific time periods in English literature or individual author studies.\r\n    Assess students throughout the semester with a series of literary analysis papers, with a 97 percent rate of skills improvement.', 'Expert English literature and language university professor with more than 22 years of experience teaching at the college level. Distinguished record of publication in academic journals all over the world. Commitment to helping university students develop their full potential in their studies. Strong philosophy of teaching, and knowledge of many different methods to motivate students to develop their expertise in specific areas. Dedicated partner to university programs and outreach events that help promote learning and support the community.', 'Male', 'oto', '600', '1200', 'tteam@utsin.com', 'NE5heDc3Tm02aXhuVXFLY0J4NDljdz09', '7095242642', '', 'Active', '', '', '', 'assets/experts/10879.jpg', 'CSE', '2020-10-09 10:26:59', '0000-00-00 00:00:00', 1),
