(5, 43, NULL, 'B-Tech Civil engineering', '4 Years', '', '<p style=\"margin: 0.5em 0px; color: rgb(32, 33, 34); font-family: sans-serif;\"><b>Civil engineering</b>&nbsp;is a&nbsp;<a href=\"https://en.wikipedia.org/wiki/Regulation_and_licensure_in_engineering\" title=\"Regulation and licensure in engineering\" style=\"color: rgb(11, 0, 128); background-image: none; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">professional engineering</a>&nbsp;discipline that deals with the design, construction, and maintenance of the physical and naturally built environment, including public works such as roads, bridges, canals, dams, airports, sewerage systems, pipelines, structural components of buildings, and railways.<sup id=\"cite_ref-1\" class=\"reference\" style=\"line-height: 1; unicode-bidi: isolate; white-space: nowrap; font-size: 11.2px;\"><a href=\"https://en.wikipedia.org/wiki/Civil_engineering#cite_note-1\" style=\"color: rgb(11, 0, 128); background-image: none; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">[1]</a></sup><sup id=\"cite_ref-2\" class=\"reference\" style=\"line-height: 1; unicode-bidi: isolate; white-space: nowrap; font-size: 11.2px;\"><a href=\"https://en.wikipedia.org/wiki/Civil_engineering#cite_note-2\" style=\"color: rgb(11, 0, 128); background-image: none; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">[2]</a></sup></p><p style=\"margin: 0.5em 0px; color: rgb(32, 33, 34); font-family: sans-serif;\">Civil engineering is traditionally broken into a number of sub-disciplines. It is considered the second-oldest engineering discipline after&nbsp;<a href=\"https://en.wikipedia.org/wiki/Military_engineering\" title=\"Military engineering\" style=\"color: rgb(11, 0, 128); background-image: none; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">military engineering</a>,<sup id=\"cite_ref-CSCE_3-0\" class=\"reference\" style=\"line-height: 1; unicode-bidi: isolate; white-space: nowrap; font-size: 11.2px;\"><a href=\"https://en.wikipedia.org/wiki/Civil_engineering#cite_note-CSCE-3\" style=\"color: rgb(11, 0, 128); background-image: none; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">[3]</a></sup>&nbsp;and it is defined to distinguish non-military engineering from military engineering.<sup id=\"cite_ref-eb_4-0\" class=\"reference\" style=\"line-height: 1; unicode-bidi: isolate; white-space: nowrap; font-size: 11.2px;\"><a href=\"https://en.wikipedia.org/wiki/Civil_engineering#cite_note-eb-4\" style=\"color: rgb(11, 0, 128); background-image: none; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">[4]</a></sup>&nbsp;Civil engineering takes place in the public sector from municipal through to national governments, and in the private sector from individual homeowners through to international companies.</p>', '', '', '', 1),
(6, 43, NULL, 'B-Tech ', '4 Years', '107000 per year', '<p><b style=\"color: rgb(32, 33, 34); font-family: sans-serif;\">Civil engineering</b><span style=\"color: rgb(32, 33, 34); font-family: sans-serif;\">is a</span><a href=\"https://en.wikipedia.org/wiki/Regulation_and_licensure_in_engineering\" title=\"Regulation and licensure in engineering\" style=\"color: rgb(11, 0, 128); background: none rgb(255, 255, 255); font-family: sans-serif;\">professional engineering</a><span style=\"color: rgb(32, 33, 34); font-family: sans-serif;\">discipline that deals with the design, construction, and maintenance of the physical and naturally built environment, including public works such as roads, bridges, canals, dams, airports, sewerage systems, pipelines, structural components of buildings, and railways.</span><br></p>', '', 'no', 'Civil engineering', 1),
(11, 43, NULL, 'B-Tech ', '4 years', '107000 per year', '<p style=\"margin-right: 0px; margin-bottom: 0px; margin-left: 0px; color: rgb(51, 51, 51); font-family: WorkSans-Regular;\">The department of Electronics and Communication Engineering was established in the year 2001 and current intake is 300 students. The department offers undergraduate program B.Tech in Electronics and Communication engineering department has highly qualified faculty with 8 Professors, 14 Associate Professors and 35 Assistant Professors.The department is geared up with outcome based education imparted to the students. Students at the department are consistently provided with opportunities to upgrade their technical knowledge and develop skills that make them best employable, qualified for higher education or develop them as a strong entrepreneur The teaching faculty is actively engaged in research and they published papers in National/International conference proceedings/Journals. As a part of the curriculum, Industrial visits are arranged for students. The Institute has an IETE & IEEE Student\'s Chapter. The students actively participate in the various activities of IETE and IEEE. Special Soft skills, aptitude and technical trainings are imparted to the students as a part of regular curriculum to make them excel in their career. The department classrooms are much spacious with LCD projectors fitted for conducting e-lectures to make learning a better experience in the department. The department also has well established and well equipped laboratories for students technical pursuit. Faculty members are being onstantly encouraged to develop themselves through Various FDPs, conferences, workshops, publications, R& D activities and Massive Open Online Courses (MOOCs) exams. They are exposed to latest technologies like IoT, Robotics, Solar applications, Machine Designing, etc. through special labs established by experts in these fields</p><p style=\"margin-right: 0px; margin-bottom: 0px; margin-left: 0px; color: rgb(51, 51, 51); font-family: WorkSans-Regular;\">Students are also made industry ready through various trainings, regular company internships, mini and major projects</p>', '', 'no', 'Electronics and Communication Engineering', 0),
(12, 43, NULL, 'B-Tech', '4 Years', '107000 per year', '<p><span style=\"color: rgb(51, 51, 51); font-family: WorkSans-Regular;\">Department of Electrical and Electronics Engineering was established in the year 2001 with an intake of 40 students , in 2002 the intake has increased to 60 students and in the year 2009 intake has increased to 120 students. The department of Electrical and Electronics Engineering is NBA Accredited and the institution has accreditated by NAAC and certified by ISO. The Department offers 4 years B.Tech Degree in Electrical and Electronics Engineering.</span><span style=\"color: rgb(51, 51, 51); font-family: WorkSans-Regular;\">The Department has a separate building state-of-art laboratories with latest equipment, advanced versions of software and demo units. The laboratories are developed in consultation with the Industry and Academic experts to provide industrial environment along with the University curriculum. The department has rich experienced and dedicated faculty with the background of Industry, Teaching and Research. The faculty is specialized in the areas of Power Electronics, Power Systems, Energy Systems, Instrumentation and Control Systems to provide excellent knowledge in the core subjects.</span><span style=\"color: rgb(51, 51, 51); font-family: WorkSans-Regular;\">The Department organizes regularly Faculty Development Programmes, Seminars, Industrial visits and Expert lectures from Industry and Research Institutions to mould enthusiastic students into excellent engineers, while exposure to the latest technologies fosters the creativity and independent thinking of students.</span><span style=\"color: rgb(51, 51, 51); font-family: WorkSans-Regular;\">The department was funded by AICTE in the scheme of MODROBS of Rs. Six Lakhs</span><strong style=\"font-weight: bold; color: rgb(51, 51, 51); font-family: WorkSans-Regular;\">In the department presently 06 faculty members are pursuing Ph.D.from Osmania / JNTU Universities from which 02 faculty members are about to submit Thesis and all faculty members are fully qualified as per AICTE and JNTU Norms.</strong><br></p>', '', 'no', 'Electricals and Electronics Engineering', 0),
(13, 43, NULL, 'B-Tech ', '4 Years', '107000 per year', '<p style=\"margin-right: 0px; margin-bottom: 0px; margin-left: 0px; color: rgb(51, 51, 51); font-family: WorkSans-Regular;\">Department of Information Technology was established in the year 2001. The department offers a 4 year B.Tech. degree programme in Information Technology with an annual intake of 60 students.The department has 6 state-of-the-art computer laboratories for IT Workshop, Data Warehousing and Data Mining, Advanced Data Structures, DBMS, Computer Networks, Mobile Application Development and Advanced English Communication Skills. The students are trained to be responsive for the ever changing IT work-force needs. They are encouraged in general, intellectual, human and social qualities necessary for successful practice profession.Our institution has industry-academy collaboration with Adobe Creative Technology Academy and Red Hat Academy for students.The department strives to build a highly motivated R&D team in collaboration with some of the top research based organizations. With specific emphasis on emerging technologies and empirical mode of learning, the programme ensures that students effectively meet the highest benchmarks of competence required by the industry.</p>', '', 'no', 'Information Technology', 0),
(14, 43, NULL, 'B-Tech ', '4 Years', '107000 per year', '<p><span style=\"color: rgb(51, 51, 51); font-family: WorkSans-Regular;\">The department of Mechanical Engineering was established in the year 2003, offering under graduate and post graduate programs with the annual intake of 240 & 18 students respectively. The prime objective course is to provide students with a sound mechanical engineering education, advance the understanding and application of mechanical engineering principles. The department is accredited by NBA for its excellent infrastructure and facilities. The Department provides facilities for students to learn soft skills and achieve holistic personality.</span><span style=\"color: rgb(51, 51, 51); font-family: WorkSans-Regular;\">Majority of the faculty members are actively involved in research activities in the fields of their specialization. They have published a good number of research papers in International / National Journals and International / National Conferences. The faculty in the department interacts closely with industry enabling the graduates completely successful not only at the national level but also at the global level. Nano technology, Vibration and Stability of Fluid conveying pipes and Exhaust emission analysis of Dual fuel engines are the thrust areas of research.</span><br></p>', '', 'no', 'Mechanical Engineering', 0),
(15, 43, NULL, 'B-Tech ', '4 Years', '107000 per year', '<p><span style=\"color: rgb(51, 51, 51); font-family: WorkSans-Regular;\">The Department of Computer Science & Engineering was established in the year 2001, offering under graduate and post graduate programs with the annual intake of 300 & 36 students respectively. The laboratories of the department are well equipped with advanced and sophisticated instruments, to fully satisfy the training needs of the students. A pre-placement training program and add-on courses (over and above the syllabi) from tie ups and MOUs with industries is in place and accommodated along with the class work from second year onwards. The department is qualitatively standardized with NBA and NAAC Accreditation.</span><span style=\"color: rgb(51, 51, 51); font-family: WorkSans-Regular;\">The Department has four State-of-the-Art Computer Laboratories each with 66 Compaq Dual Core systems of high end configuration and one Laptop Lab of 70 systems with latest configuration and Wifi connectivity. The department boasts of an additional lab of 30 systems exclusively for M.Tech students. There are three high end servers of HP PROLIANT series used for JNTU online exam in addition to a Window server and Linux server catering to the intranet and web needs.</span><span style=\"color: rgb(51, 51, 51); font-family: WorkSans-Regular;\">The department aims at working on consultancy based projects from industry. The department strives to build a highly motivated R&D team in collaboration with some of the top research based organizations. The research could be implemented as fund based projects from government/ private industry. The department has tied up with professional bodies like IEEE, CSI, ISTE and built professional student chapters.</span><br></p>', '', 'no', 'Computer science& Engineering', 0),
(22, 42, NULL, 'BSC', '3', '35000', '<p>this is a physics course</p><p><br></p>', '<p>merit scholar ship available</p>', 'yes', 'Physics', 0),
(26, 56, NULL, 'Bachelor of Technology                                       ', '4 Years', '35000', '<p>Computer Science &amp; Engineering<br></p>', '<p>Candidates with 85% marks in +2 are eligible</p>', 'yes', 'Computer Science & Engineering', 0),
(27, 56, NULL, 'Bachelor of Technology                                       ', '4 Years', '35000', '<p>Civil Engineering<br></p>', '<p>Candidates with 80% marks in +2 are eligible</p>', 'yes', 'Civil Engineering', 0),
(28, 56, NULL, 'Bachelor of Technology                                       ', '4 Years', '35000', '', '', 'no', 'Mechanical Engineering', 0),
(29, 58, NULL, 'Bachelor of Engineering', '4 Years', '100000', '<p style=\"margin-right: 0px; margin-bottom: 20px; margin-left: 0px; padding: 0px; border: 0px; vertical-align: baseline; overflow-wrap: break-word; color: rgb(80, 80, 80); line-height: 1.66em; font-family: &quot;Open Sans&quot;;\">Computer Engineering focuses specifically on computer hardware and software. It is an integration of computer science and electrical engineering, a field that touches just about every segment of our lives today, from the cars we drive to the movies we watch to the many ways we all interact with each other (not to mention with businesses and government).</p><p style=\"margin-right: 0px; margin-bottom: 20px; margin-left: 0px; padding: 0px; border: 0px; vertical-align: baseline; overflow-wrap: break-word; color: rgb(80, 80, 80); line-height: 1.66em; font-family: &quot;Open Sans&quot;;\">Computer engineering is much more than programming; it is about inventing and building solutions. It is the most creative field where a computer engineer is an artist whose canvas may be a smartphone or PC display and whose paints and brushes are programming languages and development environments. Can you now imagine a world without Instagram, Snap-chat, Facebook, or Twitter? With a major in computer engineering degree, only sky is the limit.</p>', '', 'no', 'Computer Engineering', 0),
(30, 58, NULL, 'Bachelor of Engineering', '4 Years', '100000', '<p style=\"margin-right: 0px; margin-bottom: 20px; margin-left: 0px; padding: 0px; border: 0px; vertical-align: baseline; overflow-wrap: break-word; color: rgb(80, 80, 80); line-height: 1.66em; font-family: &quot;Open Sans&quot;;\">Information Technology is that engineering division which concentrates on the study of utilizing computers and telecommunications in order to control, gather, store, and circulate information. Both software and hardware sectors are parts of Information Technology.</p><p style=\"margin-right: 0px; margin-bottom: 20px; margin-left: 0px; padding: 0px; border: 0px; vertical-align: baseline; overflow-wrap: break-word; color: rgb(80, 80, 80); line-height: 1.66em; font-family: &quot;Open Sans&quot;;\">With the emergence of computers, we are witnessing a metamorphosis in the business world. Starting from multi-national corporations to small businesses, IT plays a huge role in making life easy. IT plays a pivotal role in the field of Communication, Inventory Management, Data Management, Management Information Systems, Customer Relationship Management, and many more. IT has also helped in overcoming the restrictions through fresh concepts like online shopping, digital marketing, social networking, digital communication, cloud computing, Mobile, and big data. Also, IT has developed various tools and software applications that reduce manual work.</p>', '', 'no', 'Information Technology', 0),
(31, 58, NULL, 'Bachelor of Engineering', '4 Years', '100000', '<p style=\"margin-right: 0px; margin-bottom: 20px; margin-left: 0px; padding: 0px; border: 0px; vertical-align: baseline; overflow-wrap: break-word; color: rgb(80, 80, 80); line-height: 1.66em; font-family: &quot;Open Sans&quot;; text-align: justify;\">Electrical Engineering is one of the largest and fastest growing fields which generally deals with the study and application of energy- generation, transmission and distribution, electrical motors and drives, measurement, control and automation. The mission of the department is to offer quality instruction and undertake scholarly research that engages each student in a challenging electrical engineering education and prepares graduates for the full range of career opportunities in the high technology marketplace, enabling them to reach their fullest potential as a professional and as a member of society. It is also one of the most challenging branches with a blend of challenging subjects like Engineering Mathematics, circuit and networks, power system, Control Systems, Power Electronics and drives, Switchgear and Protection, Renewable energy etc.</p><p style=\"margin-right: 0px; margin-bottom: 20px; margin-left: 0px; padding: 0px; border: 0px; vertical-align: baseline; overflow-wrap: break-word; color: rgb(80, 80, 80); line-height: 1.66em; font-family: &quot;Open Sans&quot;; text-align: justify;\">Electrical Engineering has a wide scope in todays industrial requirement era as without energy survival of anything is not possible. Due to diversities in industry requirement electrical engineering has been subdivided into various specializations like High Voltage Engineering, Power system engineering, renewable energy and technology, control and automations, power electronics and drives. Each of these fields of Electrical Engineering has its own relevance and role in the industry.</p><p style=\"margin-right: 0px; margin-bottom: 20px; margin-left: 0px; padding: 0px; border: 0px; vertical-align: baseline; overflow-wrap: break-word; color: rgb(80, 80, 80); line-height: 1.66em; font-family: &quot;Open Sans&quot;; text-align: justify;\">The department also offers Post Graduate programs in Electrical Engineering (Power System), Electrical Engineering (Power electronics and electrical drives) and Electric &amp; Hybrid Vehicle.</p>', '', 'no', 'Electrical Engineering', 0),
(32, 58, NULL, 'Bachelor of Engineering', '4 Years', '100000', '<p><span style=\"color: rgb(80, 80, 80); font-family: &quot;Open Sans&quot;;\">Automobile Engineering is one of the popular engineering branches nowadays that widely deals with transportation mechanisms and machinery. A large number of cars, trucks and numerous heavy vehicles are in demand nowadays which expect the best performance in the least investments. The main concern of the automobile industry is to make heavy-duty vehicles which offer the best fuel mileage given by the engine and least maintenance cost</span><br></p>', '', 'no', 'Automobile Engineering', 0),
(33, 58, NULL, 'Bachelor of Engineering', '4 Years', '100000', '<p style=\"margin-right: 0px; margin-bottom: 20px; margin-left: 0px; padding: 0px; border: 0px; vertical-align: baseline; overflow-wrap: break-word; color: rgb(80, 80, 80); line-height: 1.66em; font-family: &quot;Open Sans&quot;;\">Chemical Engineering is a branch of engineering that provides the necessary knowledge to convert raw materials into useful products within the realm of economy and profit. Its knowledge further helps to optimize the existing manufacturing processes thereby achieving an economical cost of production.</p><p style=\"margin-right: 0px; margin-bottom: 20px; margin-left: 0px; padding: 0px; border: 0px; vertical-align: baseline; overflow-wrap: break-word; color: rgb(80, 80, 80); line-height: 1.66em; font-family: &quot;Open Sans&quot;;\">Today, when more emphasis is given to reduction in production cost and innovation, Chemical Engineers are in huge demand in India and worldwide. Graduate Chemical Engineers find themselves working in Chemical-Production Facilities, Plant-Designing, Marketing, Environmental-Protection Auditing, Research and Development, and many such new-age professions.</p>', '', 'no', 'Chemical Engineering', 0),
(34, 58, NULL, 'Bachelor of Engineering', '4 Years', '100000', '<p><span style=\"color: rgb(80, 80, 80); font-family: &quot;Open Sans&quot;;\">Civil Engineering is the platform on which all the other engineering branches reside. Civil Engineering mainly deals with setting up an infrastructure where the applications of other engineering branches can be executed under a safe and reliable surround. Marwadi University  the Best Civil Engineering College in Rajkot, prepare professionals to be highly precise and skilled in their domain.</span><br></p>', '', 'no', 'Civil Engineering', 0),
(35, 58, NULL, 'Bachelor of Engineering', '4 Years', '100000', '<p style=\"margin-right: 0px; margin-bottom: 20px; margin-left: 0px; padding: 0px; border: 0px; vertical-align: baseline; overflow-wrap: break-word; color: rgb(80, 80, 80); line-height: 1.66em; font-family: &quot;Open Sans&quot;;\">Mechanical Engineering is one of the oldest branches that has prevailed since the emergence of humanity. The development of humanity was fastened with the initial applications of mechanical tools like the wheel, pulley and several other which has led to the inventions of large vehicles and heavy machinery like the airplane, ships, grinders, etc. The foundation of every device that we use today is an application of mechanical Engineering directly or indirectly.</p><p style=\"margin-right: 0px; margin-bottom: 20px; margin-left: 0px; padding: 0px; border: 0px; vertical-align: baseline; overflow-wrap: break-word; color: rgb(80, 80, 80); line-height: 1.66em; font-family: &quot;Open Sans&quot;;\">At Marwadi University  the Best Mechanical Engineering College in Rajkot student is taken through innovative learning processes where a large number of labs have been set up equipped with the latest machinery. The only aim of the Mechanical Engineering Department is to facilitate the students with real scenarios rather than just bookish learning. Major labs and workshops offer wide opportunities for practicing and learning the concepts of mechanical engineering through a hands-on practice session for creating, integrating and maintaining the mechanical components that are responsible for driving huge machinery.</p>', '', 'no', 'Mechanical Engineering', 0),
(36, 58, NULL, 'Bachelor of Engineering', '4 Years', '100000', '<p style=\"margin-right: 0px; margin-bottom: 20px; margin-left: 0px; padding: 0px; border: 0px; vertical-align: baseline; overflow-wrap: break-word; color: rgb(80, 80, 80); line-height: 1.66em; font-family: &quot;Open Sans&quot;;\">In simple terms, Big Data represents the information assets characterized by such a high volume, velocity, and variety to require specific technology and analytical methods for its transformation into value. Big Data consists of aspects such as</p><ul class=\"lists\" style=\"margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0px; border: 0px; vertical-align: baseline; list-style: none; width: 793.328px; float: left; position: relative; color: rgb(80, 80, 80); font-family: &quot;Open Sans&quot;;\"><li style=\"border: 0px; vertical-align: baseline; list-style: none; position: relative; width: 793.328px; float: left; margin: 5px 0px !important; padding: 0px 0px 0px 20px !important;\">Machine Learning and AI</li><li style=\"border: 0px; vertical-align: baseline; list-style: none; position: relative; width: 793.328px; float: left; margin: 5px 0px !important; padding: 0px 0px 0px 20px !important;\">Digital Footprint</li><li style=\"border: 0px; vertical-align: baseline; list-style: none; position: relative; width: 793.328px; float: left; margin: 5px 0px !important; padding: 0px 0px 0px 20px !important;\">Statistics</li><li style=\"border: 0px; vertical-align: baseline; list-style: none; position: relative; width: 793.328px; float: left; margin: 5px 0px !important; padding: 0px 0px 0px 20px !important;\">Business Intelligence</li></ul><p style=\"margin-right: 0px; margin-bottom: 20px; margin-left: 0px; padding: 0px; border: 0px; vertical-align: baseline; overflow-wrap: break-word; color: rgb(80, 80, 80); line-height: 1.66em; font-family: &quot;Open Sans&quot;;\">Big Data techniques can be used to process a large set of data, data which is otherwise largely useless (unless it is interpreted and processes properly). The interpreted data can then be used for various purposes such as  strategic planning, R&amp;D, education, governance, etc. Its applications are many. It covers (but is not limited to) the following domains </p><ul class=\"lists half-list\" style=\"margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0px; border: 0px; vertical-align: baseline; list-style: none; width: 793.328px; float: left; position: relative; color: rgb(80, 80, 80); font-family: &quot;Open Sans&quot;;\"><li style=\"padding-right: 20px; border: 0px; vertical-align: top; list-style: none; position: relative; width: 388.719px; float: none; display: inline-block; margin: 5px 0px !important; padding-top: 0px !important; padding-bottom: 0px !important; padding-left: 20px !important;\">Education</li>&nbsp;<li style=\"padding-right: 20px; border: 0px; vertical-align: top; list-style: none; position: relative; width: 388.719px; float: none; display: inline-block; margin: 5px 0px !important; padding-top: 0px !important; padding-bottom: 0px !important; padding-left: 20px !important;\">Business</li>&nbsp;<li style=\"padding-right: 20px; border: 0px; vertical-align: top; list-style: none; position: relative; width: 388.719px; float: none; display: inline-block; margin: 5px 0px !important; padding-top: 0px !important; padding-bottom: 0px !important; padding-left: 20px !important;\">Marketing and Sales</li>&nbsp;<li style=\"padding-right: 20px; border: 0px; vertical-align: top; list-style: none; position: relative; width: 388.719px; float: none; display: inline-block; margin: 5px 0px !important; padding-top: 0px !important; padding-bottom: 0px !important; padding-left: 20px !important;\">Military and Governance</li>&nbsp;<li style=\"padding-right: 20px; border: 0px; vertical-align: top; list-style: none; position: relative; width: 388.719px; float: none; display: inline-block; margin: 5px 0px !important; padding-top: 0px !important; padding-bottom: 0px !important; padding-left: 20px !important;\">Research and Development</li>&nbsp;<li style=\"padding-right: 20px; border: 0px; vertical-align: top; list-style: none; position: relative; width: 388.719px; float: none; display: inline-block; margin: 5px 0px !important; padding-top: 0px !important; padding-bottom: 0px !important; padding-left: 20px !important;\">Healthcare</li>&nbsp;<li style=\"padding-right: 20px; border: 0px; vertical-align: top; list-style: none; position: relative; width: 388.719px; float: none; display: inline-block; margin: 5px 0px !important; padding-top: 0px !important; padding-bottom: 0px !important; padding-left: 20px !important;\">Manufacturing</li>&nbsp;<li style=\"padding-right: 20px; border: 0px; vertical-align: top; list-style: none; position: relative; width: 388.719px; float: none; display: inline-block; margin: 5px 0px !important; padding-top: 0px !important; padding-bottom: 0px !important; padding-left: 20px !important;\">Media</li>&nbsp;<li style=\"padding-right: 20px; border: 0px; vertical-align: top; list-style: none; position: relative; width: 388.719px; float: none; display: inline-block; margin: 5px 0px !important; padding-top: 0px !important; padding-bottom: 0px !important; padding-left: 20px !important;\">Internet of Things</li>&nbsp;<li style=\"padding-right: 20px; border: 0px; vertical-align: top; list-style: none; position: relative; width: 388.719px; float: none; display: inline-block; margin: 5px 0px !important; padding-top: 0px !important; padding-bottom: 0px !important; padding-left: 20px !important;\">Media</li>&nbsp;<li style=\"padding-right: 20px; border: 0px; vertical-align: top; list-style: none; position: relative; width: 388.719px; float: none; display: inline-block; margin: 5px 0px !important; padding-top: 0px !important; padding-bottom: 0px !important; padding-left: 20px !important;\">IT and CS</li></ul>', '', 'no', 'Computer Engineering (Big Data & Analytics Engineering)', 0),
(37, 58, NULL, 'Bachelor of Engineering', '4 Years', '100000', '<p style=\"margin-right: 0px; margin-bottom: 20px; margin-left: 0px; padding: 0px; border: 0px; vertical-align: baseline; overflow-wrap: break-word; color: rgb(80, 80, 80); line-height: 1.66em; font-family: &quot;Open Sans&quot;;\">The last few decades have seen exponential growth in the field of Artificial Intelligence (AI). Artificial Intelligence is a sub-branch of Computer science. Technically, it is the science that helps develop computer machines that mimic human intelligence. Thus, these machines will be able to visually perceive things, recognize and differentiate speech, make decisions, translate between languages and so much more. There are two main reasons why Artificial Intelligence has become a popular choice in many fields</p><p style=\"margin-right: 0px; margin-bottom: 20px; margin-left: 0px; padding: 0px; border: 0px; vertical-align: baseline; overflow-wrap: break-word; color: rgb(80, 80, 80); line-height: 1.66em; font-family: &quot;Open Sans&quot;;\">So, the main objectives of B. Tech with Artificial Intelligence specialization are:</p><ul class=\"lists\" style=\"margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0px; border: 0px; vertical-align: baseline; list-style: none; width: 793.328px; float: left; position: relative; color: rgb(80, 80, 80); font-family: &quot;Open Sans&quot;;\"><li style=\"border: 0px; vertical-align: baseline; list-style: none; position: relative; width: 793.328px; float: left; margin: 5px 0px !important; padding: 0px 0px 0px 20px !important;\">Low error probability: Since human capabilities have their limitations, using AI will help reduce the risks of errors to a great extent. It will also increase the accuracy of results obtained, making it a much more efficient choice.</li><li style=\"border: 0px; vertical-align: baseline; list-style: none; position: relative; width: 793.328px; float: left; margin: 5px 0px !important; padding: 0px 0px 0px 20px !important;\">Overcomes limitations: There are some applications such as mining exploration and ocean exploration where human intervention has its limitations. In such a scenario, you can use AI to get the job done in no time at all.</li></ul><p style=\"margin-right: 0px; margin-bottom: 20px; margin-left: 0px; padding: 0px; border: 0px; vertical-align: baseline; overflow-wrap: break-word; color: rgb(80, 80, 80); line-height: 1.66em; font-family: &quot;Open Sans&quot;;\">Studying artificial intelligence opens a world of opportunities. In the field of artificial intelligence, the opportunities are truly endless. Learning in the artificial intelligence field could help you to perform complex tasks that are otherwise hard to perform. It uses various concepts of Neural Networks, Image Processing, Natural Language Processing, etc. Marwadi University is first in the region to offer UG specialization in Artificial Intelligence domain.</p>', '', 'no', 'Computer Engineering (Artificial Intelligence)', 0),
(38, 58, NULL, 'Bachelor of Technology', '4 Years', '100000', '<p><span style=\"color: rgb(80, 80, 80); font-family: &quot;Open Sans&quot;;\">The program is designed for students aspiring to develop cutting-edge technology in the field of Information and Communication. Students are taught about communications systems under which they get to know about radar systems, wireless system design, computational electromagnetics. The other aspects which students would get to know are related to satellite communications and telecommunication system since mobile phones and the internet have penetrated every sphere of our life. Hence, it is important to ensure that students are aware of the latest developments that are taking place in this field. Students get to know as to how to provide immediate connectivity through voice, visual and data.</span><br></p>', '', 'no', 'Information and Communication Technology', 0);
