(55, 'Methodist Engg College', 'Prabhu', 'Drector', 'tteam@utsin.com', '0000000011', 'ctxb', 'Hyderabad', 'Hyderabad', 'Telangana', 'India', 5, '', '', 'assets/institutes/46729.jpg', '', 'arial', '32px', '#aa3518', 'med@gmail.com', '0000000011', '', '', '', '', 'MXFSUkpRMUVzZDR4dUQ2UTNmSFNuUT09', '', '', '', '#3f18aa', '', '', 'www.Methodist.com', 'b', '', '', '{\"coucellors\":2,\"phone\":2,\"video\":2,\"presentation_time\":120}', '{\"coucellors\":\"\",\"phone\":\"\",\"video\":\"\",\"presentation_time\":\"\"}', 'Inactive', 0, '2020-09-22 13:11:30', '0000-00-00 00:00:00', 'Active', 0, 'Please help us serve you better by telling us about your product and service experience so far. We appreciate your business and want to make sure we meet your expectations.', 'How would you rate the KAB Education?', '', NULL, 0, 1),
(56, 'Institute for Academic Excellence', 'Shyam Kumar', 'Head-IT', 'info@iae.education', '9849966500', 'Qkty', 'Street No, 12, Himayath Nagar', 'Hyderabad', 'Telangana', 'India', 9, '', '', 'assets/institutes/03687.jpg', 'assets/institutes/4274656321309349582871009.jpg', 'Times', '40px', '#ffffff', 'head.it@rankerslearning.com', '9849966500', 'assets/institutes/Webp_net-resizeimage.jpg', 'assets/institutes/02745.jpg', '', '', 'NE5heDc3Tm02aXhuVXFLY0J4NDljdz09', '', '<p>The Institute for Academic Excellence (IAE) is an independent academic service provider dedicated in serving the Higher Educational Institutions to achieve success through developing Best practices &amp; Bench marking standards in curriculum and other related aspects. The IAE promotes / suggests academic institutions in developing academic programs, strategies and methods to enhance Institution reputation.</p><p>IAE has roots in the two decade old and renowned KAB consultants, an organisation striving for the cause of quality enhancement in the academic arena.</p><p>IAE endeavours towards the institutional building, adoption of best practices in the journey towards academic excellence of the educational institutions with which it partners. IAE bench marks with the world best standards in Academic &amp; Administrative areas and makes recommendations along with a clearly spelt road map to accomplish the same. IAE operates through a strong resource base and pool of best brains in each of the areas of operation.</p>', '<p>Key Differentiators</p><p>1) Team of Academic experts, experience in different audit processes</p><p>2) Ability to hand hold in implementing the Best Practices recommended in the chosen areas</p><p>3) Rich question bank drawn from past experience and best frameworks for review purposes</p><p>4) Professionals with the past experience in managing the program engagement of Internal Quality System, Assessments and Accreditations</p><p>5) Leveraging the existing quality Assets of the institute</p>', '#0092db', '<p>We provide services to Higher Educational Institutions to help them to raise their profiles on a global scale and become top performers in their field.</p><p>We provide meaningful and actionable inputs, to refine the strategies and to apply course corrections and to prepare Roadmap to further enhance Ranking position, Recognition, Accreditation and Grading process.</p><p><b>1) NBA, NAAC, NIRF Support</b></p><p>Preparation of SAR, SSR Reports</p><p>Assessment and Data Analysis</p><p>Collaboration for organizing Workshops</p><p><b>2) Academic &amp; Administrative Audit</b><br></p><p>Institution SWOC Analysis</p><p>Best Practices implementation Strategies</p><p>Continues Assessment and Evaluation</p><p><b>3) Assessment &amp; Enhancement</b><br></p><p>Faculty Performance</p><p>Teaching-Learning and Evaluation</p><p>Research and Professional Practice</p><p>Graduate Outcomes</p><p>Curriculum Design &amp; Development</p>', '', 'http://iae.education/', 'c', '', '[{\"name\":\"Sandhya\",\"designation\":\"Counselor\",\"from_time\":\"10:00\",\"to_time\":\"18:00\",\"contact\":\"9849966200\"}]', '{\"coucellors\":5,\"phone\":3,\"video\":3,\"presentation_time\":360}', '{\"coucellors\":\"\",\"phone\":\"\",\"video\":\"\",\"presentation_time\":\"\"}', 'Inactive', 0, '2020-09-26 10:07:13', '2020-09-26 15:37:41', 'Active', 1, 'Please help us serve you better by telling us about your experience so far. We appreciate your patience and want to make sure we meet your expectations.', 'How would you rate the Institute for Academic Excellence?', '{\"facebook\":\"https:\\/\\/www.facebook.com\\/Institute-for-Academic-Excellence-106826830721788\\/\",\"twitter\":\"https:\\/\\/twitter.com\\/for_iae\",\"instagram\":\"\",\"youtube\":\"https:\\/\\/www.youtube.com\\/channel\\/UC2sd4_2sapsenid9t387iJg?view_as=subscriber\"}', 'https://embed.tawk.to/5f884c6a2901b9207693b7b4/default', 1, 0),
(57, 'Institute KAB', 'KAB', 'KAB', 'institutekab@gmail.com', '8786878787', 'aCyV', '', '', '', '', 0, '', '', '', '', '', '', '', '', '', '', '', '', '', 'MEVyNTIyS2ttdk5qa09vT1ljcllrdz09', '', '', '', '', '', '', '', 'a', '', '', '{\"coucellors\":0,\"phone\":1,\"video\":1,\"presentation_time\":30}', '', 'Inactive', 0, '2020-10-17 12:33:06', '2020-10-17 18:03:45', 'Active', 0, '', 'How would you rate the KAB Education?', '', NULL, 0, 1),
(58, 'Marwadi University', 'Marwadi University', 'Director', 'marwadiuniversity@gmail.com', '9800000000', 'f7aO', 'Marwadi University Rajkot-Morbi Road At & PO : Gauridad, Rajkot 360 003 Gujarat.', 'Rajkot', 'Gujarat', 'India', 9, '', '', 'assets/institutes/31427.png', 'assets/institutes/1450853294206384116975673.jpg', 'arial', '40px', '#2b2b2b', 'marwadiuniversity@gmail.com', '9800000000', 'assets/institutes/Webp_net-resizeimage_(1).jpg', 'assets/institutes/32097.jpg', '', '', 'NE5heDc3Tm02aXhuVXFLY0J4NDljdz09', '', '<p>Marwadi Education Foundations Group of Institutions (MEFGI) was incepted as a major organ of Marwadi Education Foundation in 2008, under the Bombay Public Trust Act 1950. Marwadi University is promoted by Marwadi Shares and Finance Limited (MSFL) a major stock broking company in India & Chandarana Intermediaries Brokers Pvt. Ltd. (CIBPL), a leading firm dealing in technical and arbitrage trading in Indian Stock Markets. Based on the excellence achieved, Marwadi University bill was passed in Gujarat Assembly and Marwadi University was established by Gujarat Private Universities act 9 of 2016 on 9th May, 2016.<br></p>', '<div id=\"box-icon-5faa450474072\" class=\"mk-box-icon   simple_ultimate-style   clearfix\" style=\"margin: 0px 0px 25px; padding: 0px; border: 0px; vertical-align: baseline; clear: both; position: relative; backface-visibility: hidden; font-family: \"Open Sans\";\"><div class=\"left-side rounded-circle\" style=\"margin: 0px; padding: 0px 15px 0px 0px; border: 0px; vertical-align: baseline;\"><div class=\"box-detail-wrapper small-size\" style=\"margin: 0px 0px 0px 48px; padding: 0px; border: 0px; vertical-align: baseline;\"><h4 class=\"icon-box-title\" style=\"margin-right: 0px; margin-bottom: 9px; margin-left: 0px; font-weight: bold; line-height: 1.3em; overflow-wrap: break-word; text-transform: uppercase; font-size: 16px; font-family: Montserrat; color: rgb(0, 152, 163) !important;\">VISION</h4><p style=\"margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0px; border: 0px; vertical-align: baseline; overflow-wrap: break-word; color: rgb(80, 80, 80); line-height: 1.66em; position: relative; text-align: justify;\">Our vision is to address the challenges, faced by our society and planet, through education that builds capacity of our students and empowers them through their innovative thinking, practice and character building. This, in turn, would boost their creativity, while making them responsible towards the utilization of the limited natural resources to face the challenges of the 21 st century.</p></div><div class=\"clearboth\" style=\"margin: 0px; padding: 0px; border: 0px; vertical-align: baseline; visibility: hidden; clear: both; overflow: hidden; width: 0px; height: 0px;\"></div></div><div class=\"clearboth\" style=\"margin: 0px; padding: 0px; border: 0px; vertical-align: baseline; visibility: hidden; clear: both; overflow: hidden; width: 0px; height: 0px;\"></div></div><div id=\"box-icon-5faa450474a82\" class=\"mk-box-icon   simple_ultimate-style   clearfix\" style=\"margin: 0px 0px 25px; padding: 0px; border: 0px; vertical-align: baseline; clear: both; position: relative; backface-visibility: hidden; font-family: \"Open Sans\";\"><div class=\"left-side rounded-circle\" style=\"margin: 0px; padding: 0px 15px 0px 0px; border: 0px; vertical-align: baseline;\"><i class=\"mk-main-ico small \" style=\"margin: 0px auto; padding: 0px; border: 1px solid rgb(255, 186, 0); vertical-align: baseline; font-size: 32px; display: block; -webkit-box-align: center; align-items: center; border-radius: 60px; text-align: center; align-content: center; width: 32px; height: 60px !important; line-height: 60px !important; float: left; color: rgb(255, 186, 0);\"><svg class=\"mk-svg-icon\" data-name=\"mk-moon-star-6\" data-cacheid=\"icon-5faa4504752d0\" xmlns=\"http://www.w3.org/2000/svg\" viewBox=\"0 0 512 512\"><path d=\"M512 198.525l-176.89-25.704-79.11-160.291-79.108 160.291-176.892 25.704 128 124.769-30.216 176.176 158.216-83.179 158.216 83.179-30.217-176.176 128.001-124.769z\"></path></svg></i><div class=\"box-detail-wrapper small-size\" style=\"margin: 0px 0px 0px 48px; padding: 0px; border: 0px; vertical-align: baseline;\"><h4 class=\"icon-box-title\" style=\"margin-right: 0px; margin-bottom: 9px; margin-left: 0px; font-weight: bold; line-height: 1.3em; overflow-wrap: break-word; text-transform: uppercase; font-size: 16px; font-family: Montserrat; color: rgb(0, 152, 163) !important;\">PURPOSE</h4><p style=\"margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0px; border: 0px; vertical-align: baseline; overflow-wrap: break-word; color: rgb(80, 80, 80); line-height: 1.66em; position: relative; text-align: justify;\">Marwadi Education Foundation was incepted with the purpose of enhancing human capabilities. Marwadi University strives to contribute knowledge & skill to augment human life and provide immense opportunities to every individual to discover his true potential. The commitment to provide best and industry relevant education.</p></div></div></div>', '#bafdfc', '<h4 class=\"icon-box-title\" style=\"margin-right: 0px; margin-bottom: 9px; margin-left: 0px; font-weight: bold; line-height: 1.3em; overflow-wrap: break-word; text-transform: uppercase; font-size: 16px; font-family: Montserrat; color: rgb(0, 152, 163) !important;\">MISSION</h4><ul style=\"margin-right: 0px; margin-bottom: 1em; margin-left: 1.5em; padding: 0px; border: 0px; vertical-align: baseline; list-style-position: initial; list-style-image: initial; font-family: \"Open Sans\";\"><li style=\"margin: 0px 0px 0px 0.85em; padding: 0px; border: 0px; vertical-align: baseline;\">To produce creative, responsible and informed professionals .</li><li style=\"margin: 0px 0px 0px 0.85em; padding: 0px; border: 0px; vertical-align: baseline;\">To produce individuals who are digital-age literates, inventive thinkers, effective communicators and highly productive .</li><li style=\"margin: 0px 0px 0px 0.85em; padding: 0px; border: 0px; vertical-align: baseline;\">To deliver cost-effective quality education .</li><li style=\"margin: 0px 0px 0px 0.85em; padding: 0px; border: 0px; vertical-align: baseline;\">To offer world-class, cross-disciplinary education in strategic sectors of economy through well devised and synchronized delivery structure and system.</li><li style=\"margin: 0px 0px 0px 0.85em; padding: 0px; border: 0px; vertical-align: baseline;\">To provide a conducive environment that will enable students to experience higher level of learning acquired through constant immersion leading to the<br>development of character, virtues, values & technical skills.</li></ul>', '<p>Updating shortly...</p>', 'https://www.marwadiuniversity.ac.in/', 'c', '', '[{\"name\":\" Kushal\",\"designation\":\"Sr. Counselor\",\"from_time\":\"10:00\",\"to_time\":\"17:00\",\"contact\":\"9000000000\"}]', '{\"coucellors\":5,\"phone\":3,\"video\":3,\"presentation_time\":360}', '{\"coucellors\":\"\",\"phone\":\"\",\"video\":\"\",\"presentation_time\":\"\"}', 'Inactive', 0, '2020-11-06 08:00:49', '0000-00-00 00:00:00', 'Active', 0, 'Your valuable feedback helps us improve a lot.', 'How do you rate and what do you think about our Service?', '{\"facebook\":\"https:\\/\\/www.facebook.com\\/Marwadiuniversity\",\"twitter\":\"\",\"instagram\":\"https:\\/\\/www.instagram.com\\/marwadi.university\\/\",\"youtube\":\"https:\\/\\/www.youtube.com\\/user\\/marwadieducation\"}', 'https://tawk.to/chat/5fa50893fe038e7c95aa9d37/default', 0, 0),
