INSERT INTO `tbl_institute_testimonials` (`id`, `institute_id`, `st_name`, `title`, `description`, `image`, `status`, `deleted`) VALUES
(4, 42, 'Mallikarjuna Rao', 'Very Good Engineering College', 'JBIT is one of the very good Engineering Colleges located Hyderabad, it has good contacts with various companies to place the students, thousands of students have been placed till now, Faculty is very experienced and many Ph.D.s are there in the institution.', 'uploads/37452.jpg', 'Active', 0),
(5, 43, 'Ms. Bhargavi Marneni-CSE-GNITC', 'Got placed in Value Momentum', 'I am really happy to get selected in Value Momentum. This company has picked up one of the highest numbers from GNI and all the students are really excited to be part of the same. All those who are looking for a fruitful career for their children should join GNI. The PPT training which includes technical, aptitude and soft skills really help groom the students and for this initiative I am really thankful to the management of GNI.', '', 'Active', 0),
(6, 43, 'Ms. Madhumita Muduganti Reddy-CSE-GNITC', 'Got placed in Vistex', 'My life at Guru Nanak Institutions made me stronger and took me a step ahead for being an independent woman. I am thankful to all the teachers who supported us and corrected us throughout our studies. I loved the infrastructure of Guru Nanak Institutions and its International level. The events that I took part at GNI helped me to grow my confidence. I would like to specially thank the placement cell for guiding me and providing me a good platform for my career to be on track.', '', 'Active', 0),
(7, 43, 'Mr. Shailesh Kumar-CSE-GNITC', 'Got placed in Acxiom Consulting', 'Getting placed during the college is a dream for all the students and this dream came to reality when I got placed in Acxiom Consulting. I am from Nepal and my decision of joining GNI proved right when I got opportunity to work for Acxiom Consulting. I and my parents are really thankful to the management and college authorities for making my dream come into reality.', '', 'Active', 0),
(8, 43, 'Mr. Janmanchi Mohan Krishna - CSE GNITC', 'Got placed in Value labs', 'I got placed in Value Labs it is because of the efforts put by our faculties and Training and Placement cell, which always make sure that students get placed in the best company in the market. Guru Nanak Institutions provides a great exposure to students by organizing different activities which are very much helpful for every student for deciding their future field.', '', 'Active', 0),
(9, 43, 'Mr. Vamshi  MECH-GNITC', 'Got placed in Wipro Infrastructure', 'Guru Nanak Institutions has always believed in helping and guiding its students and it was no different during the placement season. Regular training classes held at our college help us to build aptitude, soft skills and technical skills. Our placement officers also guided and encouraged us at each step thereby helping me secure my placement in such a reputed company.', '', 'Active', 0),
(10, 43, 'Mr. Rishabh Sharma  CSE-GNITC', 'Got placed in TCS', 'GNI is a wonderful place for all the students seeking the right career. My college has given me and all my friends a lot of opportunities to get the right job. The staff at GNI is very supportive and really takes a lot of pain to develop the students. I am thankful to my faculties, staff and management of GNI for my success.', '', 'Active', 0),
(11, 43, 'Nisha Rawat Course: MBA', 'Agra, Uttar Pradesh', 'I wish to express my sincere gratitude to the Gurunanak Institution for providing me with the opportunity to pursue my post graduation (MBA) program with high level of training and skill development, supportive atmosphere to enhance critical and creative business thinking. It is a brilliant education centre that is highly disciplined. The outstanding infrastructure has been the attraction for foreign student also. This is one of the best experience of my life and I will surely achieve my career objectives. Honoured to be a part of Gurunanak Institution.', '', 'Active', 0),
(12, 43, 'Sonali Kastoori', 'Got placed in IBM India Pvt Ltd.', 'I am very happy to be placed with IBM. For every student its a dream to get job during their studies and I was lucky to get one. GNI takes a lot of pain to develop their students for the corporate world throughout four years at the campus. I would recommend GNI to any student who is looking for a fruitful career.', '', 'Active', 0),
(13, 43, 'Mr. Abdul W Ansari', 'Got placed in Wipro Technologies', 'I am grateful GNI- Training & Placement Department. They\'ve made efforts ensuring maximum number of placed students. Thecollege started grooming us for placements right from 2nd year. I was completely confident and cracked the aptitude and technical tests and interview rounds due to the mock tests and interviews conducted by the Training & Placement Department and our faculty members.', '', 'Active', 0),
(14, 43, 'Ms. Ogirala Alankritha', 'Got placed in Infosys', 'Our College has provided us very enhanced and efficient trainings which enabled me to bag my dream job with Infosys. I am very thankful to GNI management for providing us the best of placement opportunities.', '', 'Active', 0),
(15, 43, 'Father Name: Nageswara Rao V Student: Bhavishya Veeramachaneni', 'Parent Testimonial', 'I am feeling proud to write about GNI. I have made both of my kids complete their studies from GNI. This is one of the best campuses in Hyderabad, where all around development of the students is kept in mind, so that students can sustain in the corporate world. I am really thankful to everybody who made this possible.', '', 'Active', 0),
(16, 43, 'Abdul Moiz Ansari Father of Abdul Waheed Ansari', 'Parent Testimonial', 'I am really happy and proud today that I took the best decision in my life by joining my child in such a great institution. Its a great feeling to see my child working for such a big MNC like Wipro. It has only been possible because of all the guidance and motivation by the GNI staff.', '', 'Active', 0),
(21, 56, 'Prof. N. Shiva Prasad', 'Pro. Vice chancellor', 'Congratulations to the organizers  Department of Technical Education, Govt. of Telangana, JNTUH and KAB-IAE for choosing an excellent contemporary topic. The speakers are erudite and very well known in their respective domains. Participants in the workshop were enlightened as to how to attain better and higher ranking amongst Higher Educational Institutions.', 'uploads/73084.jpg', 'Active', 0),
(22, 56, 'Prof. B. Raja Shekhar', 'Pro Vice  Chancellor', 'Ranking of institutions is getting prominence and has become well-nigh mandatory; students who seek admissions do look at the rankings; funding is getting linked to it. Hence the importance of NIRF and this workshop. Thanks to the organizers for conceiving the thought of such a workshop and conducting it in an exemplary way.', 'uploads/42893.jpg', 'Active', 0),
(23, 56, 'Dr. V.M Pandhari Pande', 'Former Vice Chancellor', 'Quantification of quality in higher educational institutions is the order of the day and hence the relevance of NIRF workshop. We wish all success in this endeavor to all the organisers, JNTUH, KAB-IAE and the department of Technical Education. Govt. of Telangana.', 'uploads/54819.jpg', 'Active', 0),
(24, 56, 'Dr. Madhukar B.S', 'Former Advisor and General Council Executive Committee Member', 'There is no escape from accreditation and assessment which is becoming mandatory. Therefore internalization of quality is the call of the day. It is required to attract students and for the survival of the institute. That is the relevance of this workshop.', 'uploads/52390.jpg', 'Active', 0),
(25, 58, 'Amazon Development Centre (India) Pvt. Ltd ', 'Recruiter', 'Our association with the Marwadi University has been very fruitful. We have been able to pick out some very capable and confident students for our company. We are very impressed by the hard work that has been done on these students by the teachers. We would love to come back here for placements again.', 'uploads/69351.png', 'Active', 0),
(26, 58, 'Kruti Bhavish', 'Placed in Amazon Development Centre (India) Pvt. Ltd.', 'I have been selected for World\'s best E-Commerce platform, AMAZON with package of 7.2 LPA, I am very thankful to Marwadi University. Marwadi is a place, where teaching goes beyond the classroom, provides lot of placements opportunities and making every individual corporate ready.', 'uploads/05489.jpg', 'Active', 0),
(27, 58, 'Harshal Davda ', 'Placed in Yselection.com', 'I have got the offer of 9 Lac per annum. Credit goes to Marwadi University. At Marwadi, the atmosphere is full of motivation and innovation and faculties are enthusiastic and always ready to help, that helps me think out of the box. I thank my parents; my department and placement team for making my dream come true.', 'uploads/36715.png', 'Active', 0);
