INSERT INTO `tbl_news` (`news_id`, `title`, `type`, `category_id`, `createdby`, `message`, `image`, `status`, `created_date`, `is_deleted`) VALUES
(1, 'Soportere prious oy  scribentur eu', 'news', 1, 'Mark Twain', 'Mea nibh meis philosophia eu. Duis legimus efficiantur ea sea. Id placerat tacimates definitionem sea, prima quidam vim no. Duo nobis persecuti cu. Nihil facilisi indoctum an vix, ut delectus expetendis vis.', 'assets/news/27310.jpg', 'Active', '2020-08-03 22:06:56', 0),
(2, 'Duo eius postea suscipit ad', 'event', 2, 'Admin', 'Cu eum alia elit, usu in eius appareat, deleniti sapientem honestatis eos ex. In ius esse ullum vidisse', 'assets/news/62471.jpg', 'Active', '2020-08-03 22:49:44', 1),
(3, 'Pri oportere scribentur eu', 'news', 1, 'Mark Twain', 'Guidance for selection of College/Course based on EAMCET-2019, NEET-2019, JEE (Main) & JEE (Advanced) - 2019, ICET-2019, ECET-2019, PLY Guidance for selection of College/Course based on EAMCET-2019, NEET-2019, JEE (Main) & JEE (Advanced) - 2019, ICET', '', 'Active', '2020-08-03 22:06:56', 0),
(4, 'Sapientem honestatis eosuo eius postea', 'event', 2, 'Admin', 'Cu eum alia elit, usu in eius appareat, deleniti sapientem honestatis eos ex. In ius esse ullum vidisse', 'assets/news/65831.jpg', 'Active', '2020-08-03 22:49:44', 0),
(5, 'kabconsultants', 'event', 1, 'Admin', '<p class=\"MsoNormal\" style=\"line-height:normal\"><b><span lang=\"EN-IN\">1) <i>CAREER\r\nGUIDANCE SESSIONS:</i><o:p></o:p></span></b></p><p class=\"MsoNormal\" style=\"line-height:normal\"><span lang=\"EN-IN\">A series of webinars\r\nare organised to create awareness&nbsp;&nbsp; among\r\nstudents about various career courses <b>and\r\nspecialization/combinations offered by COLLEGES/universities in our country</b></span></p><p class=\"MsoNormal\" style=\"line-height:normal\"><span lang=\"EN-IN\">2) <b>VIRTUAL EDUCATION FAIR</b>:</span></p><p>\r\n\r\n\r\n\r\n\r\n\r\n</p><p class=\"MsoNormal\" style=\"line-height:normal\"><span lang=\"EN-IN\">&nbsp;KAB EDUCATION FAIR is a 3 days EXTRAVEGANZA\r\nonline event Connecting Prospective Students and INSTITUTIONS for 1st year\r\nADMISSION purpose. Very few and selected ----- colleges are invited to join on\r\nthe platform for meeting students.&nbsp;</span></p>', 'assets/news/68793.png', 'Active', '2020-08-30 06:26:16', 1),
(6, 'India faces dwindling policy options after record GDP slump', 'news', 2, 'Admin', '<p style=\"margin-right: 0px; margin-bottom: 20px; margin-left: 0px; padding: 0px; border: 0px; outline: none; color: rgb(49, 49, 49); font-family: Roboto, sans-serif; font-size: 16px; text-align: justify;\">Every student has a dream  to study a particular course or in a Specific college; it could even be a preference to study in a city of his/her choice.Parents and students need information about Best colleges and Suitable courses, be it Engineering, Medicine, Pharmacy, MBA, Law,or other professional courses; they need supporting data.</p><p style=\"margin-right: 0px; margin-bottom: 20px; margin-left: 0px; padding: 0px; border: 0px; outline: none; color: rgb(49, 49, 49); font-family: Roboto, sans-serif; font-size: 16px; text-align: justify;\">After 12th class, the choice of a course/stream and college is a crucial decision.It defines a students entire future career path. KAB Consultants being one of the best educational consultants in Hyderabad have scientific methods to do the counseling sessions and in the last 20 years, thousands of students have been benefited from our counseling sessions and got admissions in the best colleges and appropriate courses.</p>', 'assets/news/51943.jpg', 'Active', '2020-09-01 16:37:25', 1),
(7, 'ddhgdhjdhdh', 'news', 1, 'Admin', '<p><span class=\"place_cont\" style=\"-webkit-tap-highlight-color: transparent; margin: 0px; padding: 0px; font-weight: bolder; color: rgb(46, 46, 46); font-family: Roboto, sans-serif; font-size: 18px;\">New Delhi:&nbsp;</span></p><p style=\"-webkit-tap-highlight-color: transparent; margin-right: 0px; margin-bottom: 1.5rem; margin-left: 0px; padding: 0px; display: inline; color: rgb(46, 46, 46); font-family: Roboto, sans-serif; font-size: 18px;\">Former President of India Pranab Mukherjee, who died on Monday, had made his daughter Sharmistha Mukherjee custodian of the diaries he wrote almost every day during his five-decade political career and authorised her to take a call on publishing them.</p><p style=\"-webkit-tap-highlight-color: transparent; margin: 1.5rem 0px; padding: 0px; color: rgb(46, 46, 46); font-family: Roboto, sans-serif; font-size: 18px;\">\"He has left his diaries with me, and left it to my discretion whether to get them published or not,\" Sharmistha Mukherjee said.</p><p style=\"-webkit-tap-highlight-color: transparent; margin-right: 0px; margin-bottom: 1.5rem; margin-left: 0px; padding: 0px; color: rgb(46, 46, 46); font-family: Roboto, sans-serif; font-size: 18px;\">The former President, who had tested positive for coronavirus, died on Monday, weeks after his brain surgery. The 84-year had died after being in hospital for 20 days.</p><p style=\"-webkit-tap-highlight-color: transparent; margin-right: 0px; margin-bottom: 1.5rem; margin-left: 0px; padding: 0px; color: rgb(46, 46, 46); font-family: Roboto, sans-serif; font-size: 18px;\">He came into politics in 1969 and subsequently served as minister for External Affairs, Defence, Finance and Commerce and then as India\'s 13th president.</p><p style=\"-webkit-tap-highlight-color: transparent; margin-right: 0px; margin-bottom: 1.5rem; margin-left: 0px; padding: 0px; color: rgb(46, 46, 46); font-family: Roboto, sans-serif; font-size: 18px;\">Writing a diary every day was one of Pranab Mukherjee\'s ways to keep his famously encyclopaedic memory razor sharp until the very end, said his close friends.</p>', 'assets/news/13672.jpg', 'Active', '2020-09-02 15:32:08', 1),
(8, 'kujygfjuhgjhghjv', 'news', 2, 'Admin', '<p>New Delhi: Former President of India Pranab Mukherjee, who died on Monday, had made his daughter Sharmistha Mukherjee custodian of the diaries he wrote almost every day during his five-decade political career and authorised her to take a call on publishing them.</p><p>\"He has left his diaries with me, and left it to my discretion whether to get them published or not,\" Sharmistha Mukherjee said.</p><p><br></p><p>The former President, who had tested positive for coronavirus, died on Monday, weeks after his brain surgery. The 84-year had died after being in hospital for 20 days.</p><p><br></p><p>He came into politics in 1969 and subsequently served as minister for External Affairs, Defence, Finance and Commerce and then as India\'s 13th president.</p><p><br></p><p>Writing a diary every day was one of Pranab Mukherjee\'s ways to keep his famously encyclopaedic memory razor sharp until the very end, said his close friends.</p>', 'assets/news/82174.jpg', 'Active', '2020-09-02 15:37:50', 1),
(9, 'breaking news', 'news', 1, 'Admin', '<p>Companies such as Infosys, Wipro, Accenture, Zensar Technologies, among others, have embarked on a massive upskilling drive to make sure their workforce in India is ready for the next-level jobs.<br></p>', 'assets/news/85413.png', 'Active', '2020-09-03 11:54:43', 0),
