(15, 'NTA JEE Main Result 2020 HIGHLIGHTS', 'news', 6, 'KAB', '<p>The National Testing Agency (NTA) has declared the results for the Joint Entrance Examination (JEE) Main. A total of 10.23 lakh students  including both January and April attempt  had appeared for the exam. The result, rank list, final answer key are available at the official website jeemain.nta.nic.in.</p><p>A total of 24 students have scored a percent 100 percentile score. Statewise, the largest number of toppers coming from Telangana. The number of 100 percentile holders was 9 in January attempt. In the April / September attempt, 6.35 lakh candidates appeared despite the pandemic.<br></p><p>The April session was JEE Main was conducted from September 1 to 6, after it was postponed on several occasions due to COVID-19 pandemic. The exam was held at 660 centres across the country following strict COVID-19 guidelines,. The students can also download the final answer key through the official website.<br></p><p>JEE Main scores are normalised scores across multi-session papers and are based on the relative performance of all those who appeared for the examination in one session. The marks obtained are converted into a scale ranging from 100 to 0 for each session of examinees.<br></p>', 'assets/news/89670.jpg', 'Active', '2020-09-07 05:56:41', 0),
(16, 'TS EAMCET Result 2020 Soon At Eamcet.tsche.ac.in, Details Here', 'news', 4, 'KAB', '<p>TS EAMCET Result 2020 Date: The Telangana Engineering, Medical and Agriculture Common Entrance Test (EAMCET) result will be announced soon. Telangana State Council of Higher Education (TSCHE) conducted TS EAMCET 2020 for Engineering aspirants on September 9, 10, 11, and 14, 2020. Though the authorities have not officially confirmed the TS EAMCET result date, reports claim that it will be declared in the last week of September, 2020.</p><p>For Medicine and Agriculture candidates, the exam is scheduled to be held on September 28 and September 29, 2020.<br></p><p>According to official information, 1.43 lakh students registered for TS EAMCET 2020. The exam was held at 102 centres, including 23 in Andhra Pradesh.<br></p><p>TS EAMCET result will be announced on the official website, eamcet.tsche.ac.in. Candidates will be asked to use their registration number, date of birth, and qualifying examination hall ticket number to check TS EAMCET result 2020.<br></p><p>Amid the ongoing COVID-19 pandemic, TS EAMCET for Engineering aspirants was held following specific health protocols. Candidates were asked to wear masks and gloves during the exam.<br></p><p>TS EAMCET is a computer-based exam for admission to undergraduate engineering and agriculture programmes at the participating institutes across Telangana.<br></p><p>The Engineering paper of TS EAMCET had 160 questions for a total of 160 marks. There is no negative marking for wrong answers.<br></p><p>Last year, 1,31,209 candidates appeared in the EAMCET exam in Telangana for admission to engineering programmes out of whom, 1,08,213 or 82.47% students qualified.<br></p>', 'assets/news/20793.jpg', 'Active', '2020-09-07 05:57:46', 0),
(17, 'NEET 2020: Know the expected cut-off', 'event', 5, 'KAB', '<p>NEET 2020 cut-off: The National Testing Agency (NTA) will release the cut-off for the National Eligibility cum Entrance Test  NEET UG to shortlist the aspirants for admission to MBBS, BDS, AYUSH, BVSc and AH courses. The cut-off is the minimum qualifying percentile and scores which must be obtained to pass the test. The cut-off percentile to be secured for qualifying entrance exam has been released through the information brochure.</p><p><br></p><p>NEET 2020 cut-off marks will be released along with the result in online mode. The cut-off for general category candidates is 50th percentile, while that for SC/ ST/ OBC, it is 40th percentile.</p><p>Courtesy: The Indian Express</p>', 'assets/news/38951.jpg', 'Active', '2020-09-07 05:58:09', 0),
(18, 'TS EAMCET 2020: Last minute instructions, things allowed at exam centre today', 'news', 4, 'Admin', '<p>NTU Hyderabad would be conducting the exam of TS EAMCET 2020 today that is on September 9, 2020 at various centres across the state. The admit cards for the same had been released on September 3, 2020, on the official website eamcet.tsche.ac.in. Candidates who have to appear in the exams must take a quick look below to know about the dos and the donts to be followed during the paper.</p><p><br></p><p>The Engineering exam is being conducted on four days  September 9, 10, 11 and 14, 2020 from 9 am to 12 noon in the state. This year a total of 1,42,869 candidates have registered for the engineering stream and 78,000 students have registered for agriculture exam which would be conducted on September 28 and 29, 2020 and the hall ticket would be available from September 21 to 25, 2020.</p>', 'assets/news/86571.jpg', 'Active', '2020-09-09 05:30:01', 0),
(19, 'JEE Main Paper 2 Result 2020 (B.Arch & B.Plan): Know Toppers, Cut Off', 'news', 1, 'admin', '<p>New Delhi: National Testing Agency, or NTA has announced the JEE Paper 2 result 2020 at the official portal- jeemain.nta.nic.in on the evening of September 18. Candidates can access the result of JEE Main 2020 by logging into their profile and entering application number and date of birth. Details like the subject-wise marks obtained, percentile score and JEE Main cutoff will be mentioned in the JEE Main Paper 2 result 2020. JEE Mains paper 2 result 2020 also highlights the candidates all India rank and qualifying status<br></p>', 'assets/news/45987.jpg', 'Active', '2020-09-24 10:09:05', 0);
