(15, 'Shravan Goud', 'MCA', 'SJC University is great place to learn.It gives me great to say with pride that i have completed my B.tech in cse from this University.The relationship between faculities and student is very cordial, which gave me an opportunity to excel in my area of interest. The T and P cell is very supportive and they have conducted various sessions which helped me to get placed.', 'gettyimages-507910624-612x612.jpg', 'Active', 1),
